import React from "react";
import { DragDropContext, Droppable } from 'react-beautiful-dnd'

const Column = (props) => {
    return (
        <Droppable droppableId={props.id}>
            {provided => (
                {...provided.droppableProps}
            )}
             <div>
                <p>{props.content}</p>
                <p>{props.id}</p>
            </div>
        </Droppable>
    )
}

export default Column
